import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import App from './App';
import reportWebVitals from './reportWebVitals';
// our webpages works faster and stays offline
import Card from './card'; //for this, card.js was returning only signle file. i.e-> export default
import 'tachyons'; //our react wali bootstrap
import {Robot} from './robots';//this is exporting >1 file

ReactDOM.render(
  <React.StrictMode>
    <div>
      <Card />
      <Card />
      <Card />
      <Card />
    </div>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
